  body {
    overscroll-behavior: contain;
    touch-action: manipulation;
    margin: 0;
  }

  /* #LoginModal — внешний контейнер */
  #LoginModal {
    display: none;
    position: fixed;
    background-color: rgba(0, 0, 0, 0.5);
    z-index: 9999;
    justify-content: center;
    align-items: center;
    overflow-y: auto;
    box-sizing: border-box;
